import { Router, Link, Route, Routes, useNavigate, useParams} from "react-router-dom";
import { useEffect, useState } from 'react'
import { StepDescription } from "semantic-ui-react";

const View = (props) => {
    const {id} = useParams()
    const routines = props.routines
    const token = props.token
    const [name, setName] = useState('')
    const [activityId, setActivityId] = useState('')
    const [count, setCount] = useState('')
    const [duration, setDuration] = useState('')


    const singleRoutine = routines.find((r) => r.id === id)

        const addActivity = async (name, activityId, count, duration, token) => {
            try {    const response = await fetch(`http://fitnesstrac-kr.herokuapp.com/api/routines/${singleRoutine.id}/activities`, {
  method: "POST",
  headers: {
    'Content-Type': 'application/json',
    'Authorization': `Bearer ${token}`
  },
  body: JSON.stringify({
    name,
    activityId,
    count,
    duration
  })
})
const result = await response.json()
               } catch(err) {
                console.error(err)
               }
                }
                const editActivity = async (name, activityId, count, duration, token) => {
                    try {    const response = await fetch(`http://fitnesstrac-kr.herokuapp.com/api/routines/${singleRoutine.id}/activities`, {
          method: "PATCH",
          headers: {
            'Content-Type': 'application/json',
            'Authorization': `Bearer ${token}`
          },
          body: JSON.stringify({
            name,
            activityId,
            count,
            duration
          })
        })
        const result = await response.json()
                       } catch(err) {
                        console.error(err)
                       }
                        }

    return  <> 
    <h2>Routine: {singleRoutine.name}</h2>
        <h4 title={singleRoutine.name}>Is it public?: {singleRoutine.description}</h4>
        <h4 title={singleRoutine.name}>Goal: {singleRoutine.goal}</h4>
        <h2>Routine Exercises</h2>
        {
                    singleRoutine.activites? singleRoutine.activites.map((activity) => {
                       return <>
                       <h4>Exercise name: {activity.name}</h4>
                       <h4>Exercise description: {activity.description}</h4>
                       <h4>How long to do exercise: {activity.duration}</h4>
                       <h4>How many reps: {activity.count}</h4>
                       </>
               }): <h4>No Messages</h4>
               }
  { token? <form onSubmit={(event) => {
        event.preventDefault()
        editActivity(name, description, count, duration, token)
        event.target.reset()
    }}>
    <label>Edit exercise name: </label>
    <input type='textarea' onChange={(event) => {
        event.preventDefault()
        setName(event.target.value)
    }}></input>
    <input type='submit' value='send'></input>
    <label>Edit exercise description: </label>
    <input type='textarea' onChange={(event) => {
        event.preventDefault()
        setDescription(event.target.value)
    }}></input>
    <input type='submit' value='send'></input>
    <label>Edit how long to do exercise:  </label>
    <input type='textarea' onChange={(event) => {
        event.preventDefault()
        setDuration(event.target.value)
    }}></input>
    <input type='submit' value='send'></input>
    <label>Edit how many reps to do: </label>
    <input type='textarea' onChange={(event) => {
        event.preventDefault()
        setCount(event.target.value)
    }}></input>
    <input type='submit' value='send'></input>
    </form>
: null
}
{
token? <form onSubmit={(event) => {
    event.preventDefault()
    event.target.reset()
}}>

<label>Add Exercise to routine: </label>
<input type='textarea' onChange={(event) => {
    event.preventDefault()
    setName(event.target.value)
}}></input>
